import {StyleSheet} from 'react-native';
export default StyleSheet.create({
  container: {
    backgroundColor: '#36474f',
    padding: 10,
    margin: 15,
    borderRadius: 10,
  },
  input: {
    marginTop: 15,
    marginBottom: 10,
    height: 38,
    color: 'white',
    borderBottomWidth: 1,
    borderBottomColor: '#728791',
    fontSize: 16,
  },

  button_null: {
      width: 30,
    alignItems: 'center',
    backgroundColor: '#808080',
    height: 40,
    justifyContent: 'center',
    borderRadius: 10,
  },
  button_text: {color: 'white'},
  button: {
    alignItems: 'center',
    backgroundColor: '#fea500',
    height: 40,
    justifyContent: 'center',
    borderRadius: 10,
  },
});
